INSERT INTO `v1_1f4cb812e24a6fbe93aca26034dc3ed26d787a467fc8ecae6db59dc007f31f5c` VALUES (1, 0, "クウカはこんな新年早々に\n豪華な料理とたくさんの人の前で\nドSさんに弄ばれ辱めを……！\nぐふふ……ぐふふふふ。", 0, 11, 0, 513, 104511, 513048, 5, 0.5);
